import style from 'styled-components';
import foodImg from '../../assets/image/5.png';

const PostWrap = style.div`
    background-color: #ffffff;
    width: 90vw;
    height: 20vw;
    border-radius: 4vw;
    box-shadow: 1vw 1vw 2vw 0 rgba(0, 0, 0, 0.1);
    margin-bottom: 5vw;
    display: flex;
    flex-direction: row;
`;

const PostImg = style.img`
    width: 30vw;
    height: 20vw;
    margin-left: 1vw;
`;

const PostDetailWrap = style.div`
    display: flex;
    flex-direction: column;
    margin-top: 3vw;
`;

const PostName = style.div`
    font-size: 1rem;
    font-weight: 900;
`;

const PostDetail = style.div`
    font-size: 0.6rem;
    font-weight: bold;
    color: rgba(210, 210, 210, 1);
`;

const PostSign = style.div`
    font-size: 0.55rem;
    color: rgba(249, 210, 86, 1);
`;

const PostPrice = style.div`

`;

const str1 = '오징어 불짬뽕';
const str2 = '맛있게 매운 해물가득 불짬뽕';
const str3 = '9800원~';

const PostComponent = ({value}) => {
    return(
        <>
            <PostWrap>
                <PostImg src={foodImg}/>
                <PostDetailWrap>
                    <PostName>{str1}</PostName>
                    <PostDetail>{str2}</PostDetail>
                    <PostSign>signiture</PostSign>
                </PostDetailWrap>
                <PostPrice>{str3}</PostPrice>
            </PostWrap>
        </>
    );
}

export default PostComponent;
